import React,{useState,useEffect} from 'react'
import {useNavigate,useParams} from 'react-router-dom'
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css'
import axios from '../../node_modules/axios'
function Index1() {
    const [repo,setRepo]=useState([])
    let navigate=useNavigate()
    let {id}=useParams()
const getRepo=()=>{
    axios.get('http://interviewapi.stgbuild.com/getQuizData' )
    .then(response => {
        console.log(response.data.tests )
        const myRepo=response.data.tests;
       setRepo(myRepo);

    });
};
// const {tests}=axios.get('http://interviewapi.stgbuild.com/getQuizData' )
//    .then(response => {
//          console.log(response.data.tests )})
 useEffect(() => {
 getRepo()    
    }, [])
   // console.log(repo)
    function test(){
        console.log("hiii")
        navigate('/test')
    }
    return (
        <div>
                <div className="container">
        <div class="row">
            <h1>My Interview Portal</h1>
            <hr/>
            <div class="col-md-12">
                <table class="table table-striped">
                    <thead>
                        <tr>
                            <th>Test</th>
                            <th>No of Questions</th>
                            <th></th>
                        </tr>
                    </thead>
                    <tbody>
                     {repo.map((note,index)=>(

                         <tr key={index}>
                         <td>{note.name}</td>
                         <td>{note.questions.length}</td>
                          <td><button class="btn btn-warning" onClick={()=>test()}>Start Test</button></td>
                     </tr>)
                     )}



                    </tbody>
                </table>
            </div>

        </div>

        API Url: <a href="http://interviewapi.stagging.in/getQuizData" target="_blank">http://interviewapi.stagging.in/getQuizData</a>
    </div>
        </div>
    )
}

export default Index1
